import React, {Component} from "react";


class SearchBox extends Component {

   render() {
      const {onSearch} = this.props;
      return (
         <input
            className="search-box"
            type="search"
            placeholder="search monsters"
            onChange={onSearch}
         />
      )
   }
}

export default SearchBox;
